import React from 'react'
import {detailsData} from "./TableData"
import {useState} from "react"

function Details() {
const [data, setData] = useState(detailsData);

  return (
    <div>
      <p>qq{detailsData.fname}</p>
      <p>qq{detailsData.lname}</p>
      <p>qq{detailsData.ak}</p> 
      <p>qq{detailsData.age}</p>
    </div>
  )
}

export default Details
